import {
       StyleSheet, Text, Image, TouchableHighlight, View, ImageBackground,
       Alert, StatusBar, Dimensions,
       SafeAreaView, Button, Platform
} from 'react-native';
import {
       useDimensions, useDeviceOrientation
} from '@react-native-community/hooks';



 function ViewImageScreen() {
       return (
              <View style={styles.container}>
                     <View style={styles.closeIcon}></View>
                     <View style={styles.deleteIcon}></View>
                     <ImageBackground source={require("./assets/chair.jpg")} style={styles.image}>
                     </ImageBackground>
                     <View
                            style={{
                                   width: 50,
                                   height: 50,
                                   backgroundColor: "#fc5c65",
                                   top: 40,
                                   left: 30,
                                   position: "absolute"
                            }}
                     />
                    
              </View>
       );

}

export default ViewImageScreen;

const styles = StyleSheet.create({
       container: {
              backgroundColor: "#000",
              flex: 1,
       },
       closeIcon: {
              width: 50,
              height: 50,
              backgroundColor: "#fc5c65",
              top: 40,
              left: 30,
              position: "absolute"
       },
       deleteIcon: {
              width: 50,
              height: 50,
              backgroundColor: "#4ecdc4",
              top: 40,
              right: 30,
              position: "absolute"
       },
       image: {
              width: "100%",
              height: "100%",
              top: 100,
              position: "absolute"

       }
});
